function Showcase({offer}) {

	if(offer == null){
		return
	}

	return (
		<div className='showcase'>
			<div className='imgContainer'>
					<img src={offer.image} />
				</div>
			<h1>{offer.name}</h1>
			<p>{offer.description}</p>
			<span>{offer.price}</span>
		</div>
	);
}

export default Showcase;
